<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Landing Page</title>
    <style>
        html,
        body {
            width: 100%;
            height: 100%;
            min-height: 100vh;
            min-width: 100vw;
            margin: 0;
            padding: 0;
            overflow: hidden;
        }

        body {
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: floralwhite;
        }

        .floating-svg {
            position: absolute;
            width: 250px;
            /* Adjust based on your SVG size */
            animation: float 5s infinite ease-in-out;
        }

        @keyframes float {

            0%,
            100% {
                transform: translate(0px, 0px);
            }

            50% {
                transform: translate(100px, -100px);
                /* Increased range of movement */
            }
        }

        #title-svg {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 1200px;
            /* Adjust based on your title SVG size */
            z-index: 10;
            /* Ensures it stays on top of the floating SVGs */
        }

        #subtitle-svg {
            position: absolute;
            top: calc(50% + 150px);
            /* Adjust based on the size of your title SVG */
            right: 11%;
            /* Aligns the subtitle to the right */
            width: 200px;
            /* Adjust based on your subtitle SVG size */
            z-index: 10;
            /* Keeps it on top, similar to the title SVG */
        }

        #continue-text {
            position: absolute;
            bottom: 20px;
            right: 20px;
            font-family: Arial, sans-serif;
            font-size: 12px;
            color: #333;
            z-index: 20;
        }
    </style>
</head>

    <div id="continue-text">Tap SPACE to continue</div>

    <script>
        // Embedded JavaScript
        document.addEventListener('DOMContentLoaded', () => {
            const svgs = document.querySelectorAll('.floating-svg');

            svgs.forEach(svg => {
                // Random initial position
                const randomX = Math.random() * (window.innerWidth - 100); // Ensures SVGs stay within the view horizontally
                const randomY = Math.random() * (window.innerHeight - 100); // Ensures SVGs stay within the view vertically

                svg.style.left = `${randomX}px`;
                svg.style.top = `${randomY}px`;

                // Randomize animation duration and movement range
                const duration = 3 + Math.random() * 4; // Duration between 3 and 7 seconds
                const deltaX = (Math.random() - 0.5) * 400; // Random horizontal shift up to 100px left or right
                const deltaY = (Math.random() - 0.5) * 400; // Random vertical shift up to 100px up or down
                svg.style.animation = `float ${duration}s infinite ease-in-out`;
                svg.style.animationName = `float-${svg.id}`;

                const keyframes = `
                        @keyframes float-${svg.id} {
                            0%, 100% { transform: translate(0px, 0px); }
                            50% { transform: translate(${deltaX}px, ${deltaY}px); }
                        }
                    `;
                document.styleSheets[0].insertRule(keyframes, document.styleSheets[0].cssRules.length);
            });
        });
    </script>
    <script>
        document.body.addEventListener('keydown', function (event) {
            if (event.keyCode === 32) {  // 32 is the keycode for the space bar
                event.preventDefault();  // Prevent the default space bar scroll behavior
                window.location.href = 'Page2.html';  // Change 'page2.html' to your second page's URL
            }
        });
    </script>
